import React from 'react'
import './Button.css'

export default props =>
    //classes que podem ser usadas
    <button className={`

        button
        ${props.operation ? 'operation' : ''}
        ${props.double ? 'double' : ''}
        ${props.triple ? 'triple' : ''}
    `}> 
        {props.label} 
    </button>
